import React from 'react'
import ReactDOM from 'react-dom'

const TodoList = () => {
    return (
        <ul>
            <li>Todo first</li>
            <li>Todo second</li>
        </ul>

    )
}

const el = (
    <div>
        <h1>Todo List</h1>
        <input placeholder="search" />
    </div>
)

ReactDOM.render(el, document.getElementById('root'))
